	 ('freeBoard',1,146,'user2','앞집강아지','오프화이트 오버핏 반팔 사이즈 문의!','<p>180 / 73 입니다</p><p style="line-height: 180%;">xs , s중에 고민중입니다</p><p style="line-height: 180%;">기장 너무 길지않게입고싶은데 어느사이즈로 가야할까요</p>',0,17,1,0,0,0,'2021-06-29 19:33:30.0',NULL),
	 ('freeBoard',1,147,'user2','앞집강아지','듀라모 알파바운스처럼 편한가요?','<p>공홈 할인 중인데 듀라모만 하거든요</p><p style="line-height: 180%;">​</p><p style="line-height: 180%;">알파바운스만큼 편한가요 ? 듀라모가 알파바운스인줄 알았는데 그건 아니네요</p>',0,2,0,0,0,0,'2021-06-29 19:34:13.0',NULL),
	 ('freeBoard',1,148,'user2','앞집강아지','팔라스 트라이텍스 사이즈 문의!','<p>트라이텍스 반팔이구요</p><p style="line-height: 180%;">180 73 살짝 루즈하게입을건데 L괜찮을까요</p><p style="line-height: 180%;">XL은 너무 길고 폼도 클거같아서요</p>',0,1,0,0,0,0,'2021-06-29 19:35:51.0',NULL),
	 ('freeBoard',1,149,'user3','무서운호랑이','무릎발사 없는 바지','<p>님들 유일하게 무탠다드 슬랙스가 무릎발사없고 오다리 가려주는데요..</p><p style="line-height: 180%;">면바지 무릎발사 없는바지 추천좀요..</p><p style="line-height: 180%;">아님 다른 소재라도 발사없는 바지 추천좀 부탁드립니다</p>',0,7,0,0,0,0,'2021-06-29 19:37:33.0',NULL),
	 ('freeBoard',1,150,'user2','앞집강아지','꼼데 와펜 반팔 티셔츠 사이즈 문의!','<p>180cm / 80kg이고</p><p style="line-height: 180%;">메종키츠네 폭스헤드 반팔 XL 정핏으로 잘 맞습니다.</p><p style="line-height: 180%;">꼼데 와펜 기본 반팔 살려고 하는데... XL 사면 작을까요?</p>',0,0,0,0,0,0,'2021-06-29 19:44:34.0',NULL),
	 ('freeBoard',1,151,'user4','배고픈사자','무지반팔 색깔','<p>소버먼트 반팔인데 차콜색이 두개라 고민되네요</p><p style="text-align: center;line-height: 180%;">둘중에 어떤 걸로 갈까요?</p><p style="text-align: center;line-height: 180%;">참고로 피부톤은 하얀편입니다 !!</p>',0,2,0,0,0,0,'2021-06-29 19:49:08.0',NULL),
	 ('freeBoard',1,152,'user1','옆집고양이','브룩스브라더스 철수하나요?','<p>주말에 김포현대아울렛 가니</p><p style="line-height: 180%;">브룩스부라더스 매장이 물건이 없어 횡 하더군요.. 얼마나 세일을 했던거야</p><p style="line-height: 180%;">하고 들어가서 물어보니</p><p style="line-height: 180%;">철수하기로 했다고.. 넘 놀래서 왜요? 하니까</p><p style="line-height: 180%;">그러게요,, 라면서</p><p style="line-height: 180%;">다 철수한다고 얘기해준거 같아서요! 잘못들은건지,,</p><p style="line-height: 180%;">​</p><p style="line-height: 180%;">공식몰에는 운영사업자 변경에 대한 팝업만 뜨고</p><p style="line-height: 180%;">상품들이 다 없네요,,</p><p style="line-height: 180%;">뉴스기사도 딱히 없고.</p><p style="line-height: 180%;">혹시 아시는 분 계신가요?</p><p style="line-height: 180%;">​</p><p style="line-height: 180%;">브룩스브라더스 ㅠ 최애브랜드중 하나인데</p><p style="line-height: 180%;">​</p>',0,6,1,0,0,0,'2021-06-29 19:54:29.0',NULL),
	 ('freeBoard',1,153,'user3','무서운호랑이','와이드 청바지 생지 지금 입기엔 덥겟죠...?','<p>와이드 청바지 생지 지금 입기엔 덥겟죠...?</p><p style="line-height: 180%;">하나 사고싶은데ㅠㅠ... 추천좀 부탁드랴용..</p>',0,1,0,0,0,0,'2021-06-29 19:55:31.0',NULL),
	 ('freeBoard',1,154,'user2','앞집강아지','재생 원사로 만든 스니커즈 어떨까요?','<p>저스트크래프트 라는 브랜드인데</p><p style="line-height: 180%;">이래저래 서핑하다가 찾았는데 재생 나이론으로 만들었다고 하는데</p><p style="line-height: 180%;">일반 신발 착화감과 크게 다르지 않겠죠?</p><p style="line-height: 180%;">디자인도 마음에 들고 취지도 괜찮은거 같은데</p><p style="line-height: 180%;">뭔가 재질이나 착화감이 다를까 좀 걱정되네요</p>',0,0,0,0,0,0,'2021-06-29 19:56:14.0',NULL),
	 ('freeBoard',1,155,'user4','배고픈사자','스톤아일랜드 버뮤다 반바지 사이즈좀요~','<p>버뮤다 반바지 21ss 정사이즈보다 널널하게나오나요? 매물보면 커서파시는분들이 꽤나있던데 가지고계신분들 평소 바지랑 비교해서 사이즈 어떻게 가셨는지요?</p>',0,3,1,0,0,0,'2021-06-29 19:57:00.0',NULL);
